import './App.css';
import React from 'react';
import axios from 'axios';

//const url = 'https://api.openweathermap.org/data/2.5/weather'

function Resort(props) {
    const [post, temp, setPost, setTemp] = React.useState([])

    React.useEffect(() => {
        //axios.get(url, { params: {lat: props.lat, lon: props.lon, appid: props.appid, units: "imperial"}}).then((response) => {
        axios.get('https://api.openweathermap.org/data/2.5/weather?lat=39.6069742&lon=-105.97011&appid=1fc3b06f07bf594c3e96a179830ecd4c&units=imperial').then((response) => {
            setPost(response?.data)
            console.log('post: ', response.data.main.temp)
            setTemp(response?.data.main.temp)
        });
    }, [/*props*/]);

    //console.log(post)

    if (!post) return null;

    return (
        <div className='Resort'>
            <h1>{props.resortName}</h1>
            <h3>Lat: {props.lat} Long: {props.lon}</h3>
            <h3>res: {temp} </h3>
        </div>
    );
}

export default Resort;
